  true,\n\t\"url\": null,\n\t\"notes\": \"Using an ultra-light aircraft, a high-resolution
  aeromagnetic survey was carried out over Ormat Nevada's Glass Buttes project area
  in Oregon.  Survey operations were completed on May 25, 2010.nnAverage terrain clearance
  was 223 meters from the sensor. A total of 1,352 line-miles of aeromagnetic data
  were acquired.  Processed survey data includes a total magnetic intensity map, reduced
  to pole (TMI) map, horizontal gradient (RTP) map, tilt derivative (RTP) map, and
  a horizontal gradient map of the tilt derivative grid.\",\n\t\"license_title\":
